  CONSTRAINT `open_cashiers_store_id_foreign` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`),
  CONSTRAINT `open_cashiers_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
